import './App.css';
import gabriela from './img/Gabriela.png';
import React, { useState } from 'react';
import SobrePage from './pages/Sobre.js'
import './Card.css';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';




// Componente Card
const Card = ({ title, description, linkText }) => {
  return (
    <div className="card">
      <div className="card-content">
        <h2 className="card-title">{title}</h2>
        <p className="card-description">{description}</p>
        <a href="#" className="card-link">{linkText} →</a>
      </div>
    </div>
  );
};

// Componente principal App
function App() {
  const [isMenuActive, setIsMenuActive] = useState(false);

  const toggleMenu = () => {
    setIsMenuActive(!isMenuActive);
  };
  return (
    <div className="App">
      {/* Cabeçalho */}
      <header className="App-header">
        <img src={gabriela} className="gabriela-foto" alt="foto" />
        <h1>Gabriela Bárbara</h1>
        <nav className="nav-bar">
          <ul className={isMenuActive ? 'active' : ''}>
            <li><a href="/">Início</a></li>
            <li><a href="/">Sobre mim</a></li><Link to="/sobre">Sobre mim</Link>
            <li><a href="/">Feedbacks</a></li>
            <li><a href="https://www.instagram.com/umaestudantedefarmacia/" target="_blank" rel="noopener noreferrer">Contato</a></li>
          </ul>
        </nav>

        <div className="hamburger" id="hamburger" onClick={toggleMenu}>
          <span></span>
          <span></span>
          <span></span>
        </div>
      </header>
              {/* Rotas */}
              <Routes>
          <Route path="/" element={<h1>Bem-vindo(a) ao site!</h1>} />
          <Route path="/sobre" element={<SobrePage />} />
          <Route path="/feedbacks" element={<h1>Feedbacks</h1>} />
        </Routes>


      <h1 id='body-title'>Meus Produtos</h1>

      {/* Cards  */}
      <div className="card-container">
        <Card 
          title="Resuminhos" 
          description="Estude de maneira mais clara e objetiva e fixe melhor os conteúdos." 
          linkText="Ver mais"
        />
        <Card 
          title="Cronograma de estudos" 
          description="Oi, eu sou a Gabriela de Minas Gerais - Brasil" 
          linkText="Ver mais"
        />
        <Card 
          title="Cronograma de estudos" 
          description="Oi, eu sou a Gabriela de Minas Gerais - Brasil" 
          linkText="Ver mais"
        />
        <Card 
          title="E-book Gabriela" 
          description="Esse é meu e-book teste criando o site" 
          linkText="Ver mais"
        />
        <Card 
          title="Cronograma de estudos" 
          description="Oi, eu sou a Gabriela de Minas Gerais - Brasil" 
          linkText="Ver mais"
        />
        <Card 
          title="Cronograma de estudos" 
          description="Oi, eu sou a Gabriela de Minas Gerais - Brasil" 
          linkText="Ver mais"
        />
      </div>
    </div>
  );
}

export default App;
